const Favorites = () => {
  const [movies, setMovies] = useState([]);
  useEffect(() => {
   axios.get("/api/favorites").then((res) =>{ 
    console.log(res.data)
    return setMovies(res.data)});
  }, []);
  console.log(movies)
  return (
    <>
      <Link to="/">Volver</Link>
      <div>
        <ul>
          {movies.map((movie) => {
            <li>{movie.title}</li>;
          })}
        </ul>
      </div>
    </>
  );
};

export default Favorites;
